I never proactively listened to Indian film music growing up, just always indirectly through my parents. In high school, I discovered #Vintunnavaa in Telugu & #Iktara in Hindi. Listening to them on loop, I started looking for more Telugu songs, more Hindi songs, slowly realizing it's simply a vast ocean of beautiful gems I've yet to discover. So this one is a little special to me. I had this roughly recorded 3 years ago - it took a couple pushes to release this but here it is! Full video in bio/Youtube ‚ù§Ô∏è
